import React from "react";
import "../../../styles/Partials/_about.scss";


export default function About() {
  return (
    <section className="aboutWrapper">
        <h2 className="aboutMeTitle">About Me</h2>
        <p>
            I am a creative at heart. I love making all kinds of things, from websites and content to furniture. My approach is grounded in psychology, helping me connect with users on a deeper level. As a lifelong learner, I'm always expanding my coding skills and taking on new side projects.
            <br/>
            <br/>
            Outside of coding, I am the founder of Plastic Flux and a fitness enthusiast. I was formerly a high-performance dragon boat paddler üêâ for <a href="https://www.truenorthpaddlingclub.com/home">True North Paddling Club</a> (SLP Premier Open and Hammerheads). If I'm not immersed in code, you'll probably find me on the water, training or building something! For a glimpse into my journey, check out my youtube!
        </p>
    </section>
  );
}
